import React from 'react';

import CheckoutMenu from '../cart/checkoutMenu';
import classes from './address.module.css';

function Address(props){
    return(
        <div>
            <div>
                <CheckoutMenu value = "add" />
            </div>
            <div>
                <ProductBillCard 
                    tmrp = {props.tmrp} 
                    tdis = {props.tdis} 
                    tdelfee = {props.tdelfee} 
                    amount = {props.amount} 
                    itemQty = {props.len}
                />
            </div>
        </div>
    );
}

export default Address;
